import React, { useState } from 'react';
import '../Styles/HomePage.css';

function PingPongHomepage() {
  // State for form inputs
  const [zoneName, setZoneName] = useState('');
  const [searchQuery, setSearchQuery] = useState('');
  
  // Sample room data
  const rooms = [
    { id: 1, name: 'Room-Name01' },
    { id: 2, name: 'Room-Name01' },
    { id: 3, name: 'Room-Name01' },
    { id: 4, name: 'Room-Name01' }
  ];

  // Sample vibes
  const vibes = [
    { id: 1, name: 'Casual' },
    { id: 2, name: 'Gaming' },
    { id: 3, name: 'Social' },
    { id: 4, name: 'Study' },
    { id: 5, name: 'Work' },
    { id: 6, name: 'Music' },
    { id: 7, name: 'Movies' },
    { id: 8, name: 'Sports' },
    { id: 9, name: 'Tech' }
  ];

  return (
    <div className="app-container">
      {/* Main content */}
      <div className="main-content">
        {/* Header */}
        <div className="header">
          <div className="header-title">
            Welcome to Ping-Pong!!
          </div>
        </div>
        
        {/* Create zone section - Left top */}
        <div className="create-zone-section">
          <div className="section-content">
            <h2 className="section-title">Create a zone</h2>
            
            <div className="input-group">
              <label className="input-label">Zone name -</label>
              <input 
                type="text" 
                value={zoneName}
                onChange={(e) => setZoneName(e.target.value)}
                className="input-field"
              />
            </div>
            
            <div className="vibe-container">
              <p className="vibe-title">Pick a vibe:</p>
              <div className="vibe-selection">
                <div className="vibe-buttons">
                  {vibes.map(vibe => (
                    <button 
                      key={vibe.id}
                      className="vibe-button"
                    >
                      {vibe.name}
                    </button>
                  ))}
                </div>
              </div>
            </div>
            
            <button className="create-button">
              Create
            </button>
          </div>
        </div>
        
        {/* Diagonal divider - Left to Right */}
        <div className="main-diagonal-divider"></div>
        
        {/* Right section container */}
        <div className="right-sections">
          {/* Search a table section */}
          <div className="search-section">
            <div className="section-content">
              <h2 className="section-title text-center">Search a table</h2>
              <div className="search-input-container">
                <input 
                  type="text" 
                  value={searchQuery}
                  onChange={(e) => setSearchQuery(e.target.value)}
                  className="input-field"
                />
              </div>
            </div>
          </div>
          
          {/* Diagonal divider for search and join sections */}
          <div className="secondary-diagonal-divider"></div>
          
          {/* Join a table section */}
          <div className="join-section">
            <div className="section-content">
              <h2 className="section-title">Join a table</h2>
              <div className="room-list">
                {rooms.map(room => (
                  <div key={room.id} className="room-item">
                    <div className="room-name">
                      {room.name}
                    </div>
                    <div className="join-button">
                      Join this table
                    </div>
                  </div>
                ))}
              </div>
            </div>
          </div>
        </div>
        
        {/* Right sidebar - About panel */}
        <div className="sidebar">
          <div className="sidebar-title">
            About
          </div>
        </div>
      </div>
      
      {/* Footer */}
      <div className="footer">
        Made in India
      </div>
    </div>
  );
}

export default PingPongHomepage;
